import React from "react";
import Footer from "./Footer";
import Header from "./Header";

class Profile extends React.Component {

    render() {
        return (
            <>
                <Header />
                <div className="container-fluid"
                    style={{
                        backgroundColor: "#efefef"
                    }}>
                    <div class="row justify-content-center">
                        <div class="col-3 align-items-center" style={{ backgroundColor: "red" }}>
                            <div class="card">
                                <div class="card-body">
                                    <h4 class="card-title">I N F O</h4>
                                    <h6 class="card-subtitle mb-2 text-muted">You can see your personal information here.</h6>
                                </div>
                            </div>
                            <div class="form-group">
                                <input class="form-control from-control-lg" placeholder="Name" readOnly />
                                <input class="form-control from-control-lg" placeholder="Last Name" readOnly />
                                <input class="form-control from-control-lg" placeholder="Email" readOnly />
                                <input class="form-control from-control-lg" placeholder="Address" readOnly />
                                <input class="form-control from-control-lg" placeholder="Phone" readOnly />
                                <input class="form-control from-control-lg" placeholder="Credit Card" readOnly />
                            </div>
                        </div>
                    </div>
                </div>
                <Footer />
            </>
        );
    }
}

export default Profile;
